    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from the U.S. Census Bureau's Master Address Filen               / Topologically
    Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
    MTDB represents a seamless national file with no overlaps or gaps between parts,
    however, eachn               TIGER/Line shapefile is designed to stand alone as
    an independent data set, or they can be combined to cover the entire nation. The
    Census Bureau includes landmarks such as military installations inn               the
    MTDB for locating special features and to help enumerators during field operations.
    In 2008, the Census Bureau obtained the inventory and boundaries of most military
    installations from the U.S.n               Department of Defense (DOD) for Air Force,
    Army, Marine, and Navy installations and from the U.S. Department of Homeland Security
    (DHS) for Coast Guard installations. In a few cases, the filesn               supplied
    to the Census Bureau contained older, unverified information than that obtained
    from the DOD for Census 2000; in those cases the military installations in MTDB
    were reviewed, but not updatedn               to match the files obtained in 2008.",nt"license_title":
